import Image from './Image';
function Header() {
    return(
        <div className="App-header">
            <Image classname="img-logo" src="https://media-gru1-1.cdn.whatsapp.net/v/t61.24694-24/75510204_451204215558942_5136879328394948585_n.jpg?ccb=11-4&oh=01_AdQhS5OdSJzBTFTvBHK_BX-LxGZtKIRBLJrIdoz6RBlQfA&oe=653EA2A0&_nc_sid=000000&_nc_cat=107" alt="Logo"/>
            <h1 className="titulo">ENTREVERO</h1>
        </div>
    )
}

export default Header;
